script: |
  super -f tsv -I q702.sql | sort > q702.out

vector: true

inputs:
  - name: q702.sql
    data: |
      pragma pg
      SELECT col2 AS col2 FROM tab2 AS cor0 WHERE NOT ( col1 ) BETWEEN COALESCE ( 22, + ( - - col2 ) + - col2 ) + col2 AND 14 / ( - CAST ( NULL AS INTEGER ) ) GROUP BY col2 HAVING ( - 60 ) <= - col2;
  - name: tab2

outputs:
  - name: q702.out
    data: |
      58
